INSERT INTO `houses` VALUES ('66', 'Petite maison de chaume', 'Cette petite maison au toit de chaume proche de la rivière ravira les amateurs de pêche. Elle dispose d\'un étage, mais il faudra utiliser l\'échelle mise gratuitement à disposition du propriétaire, car l\'escalier n\'est pas fourni en standard avec ce type de maison.');
INSERT INTO `houses` VALUES ('67', 'Petite maison de chaume', 'Cette petite maison au toit de chaume située à proximité de la rivière, ravira les amateurs de pêche. Elle dispose d\'un étage, mais l\'escalier n\'est pas fourni, il faudra utiliser l\'échelle gracieusement offerte.');
INSERT INTO `houses` VALUES ('68', 'Petite maison', 'Cette petite maison, ne dispose que d\'un seul étage habitable, le grenier n\'est plus accessible depuis qu\'une famille de rats y habite.');
INSERT INTO `houses` VALUES ('69', 'Maison à deux étages', 'Cette maison dispose de deux étages, ce qui plaira à ceux qui aiment organiser de grandes fêtes, mais ne conviendra pas à ceux qui n\'aiment pas monter les escaliers.\n');
INSERT INTO `houses` VALUES ('70', 'Maison à un étage', 'Cette maison  est proche de la rivière et du village, ce qui compense le fait qu\'elle ne dispose que d\'un seul étage. Attention cependant, lorsque la rivière est en crue, le rez-de-chaussée est souvent inondé.');
INSERT INTO `houses` VALUES ('74', 'Maison près du magasin', 'Cette petite maison dispose d\'un étage, mais son principal avantage est d\'être située à côté du magasin de Séline et Charlotte et à quelques pas du centre du village. Elle ravira les couples qui aiment garder un peu d\'intimité avec ses deux lits séparés à l\'étage.');
INSERT INTO `houses` VALUES ('75', 'Chaumière de la fontaine', 'Cette chaumière ne dispose que d\'un seul étage, mais elle est située sur la place de la fontaine, ce qui en fait une maison de choix pour ceux qui aiment montrer leurs possessions au peuple.');
INSERT INTO `houses` VALUES ('76', 'Bâtisse de la Fontaine', 'Cette  bâtisse qui comporte tout de même deux étages, appartenait à un richissime  notaire, qui a disparu dans d\'étranges circonstances, laissant sa maison abandonnée.');
INSERT INTO `houses` VALUES ('77', 'Bâtisse près de la Taverne', 'Cette bâtisse qui dispose d\'un unique étage, est très appréciée des buveurs de bière qui peinent à retrouver leur chemin après avoir séjourné trop longtemps à la Taverne. En effet, cette bâtisse n\'est qu\'à quelques pas de la Taverne.');
INSERT INTO `houses` VALUES ('78', 'Grande Maison de Maître', 'Cette maison de maître, qui comporte trois pièces et un étage, est de toute évidence réservée aux personnes les plus riches d\'Amakna. Elle est cependant assez grande pour accueillir  plusieurs familles différentes à condition qu\'elles acceptent de vivre en communauté, un peu comme les fourmis.');
INSERT INTO `houses` VALUES ('79', 'Bâtisse de la Boulangerie', 'Cette bâtisse qui comporte un étage, servait autrefois à une célèbre boulangère, de magasin pour vendre ses pains.  Aujourd\'hui, cette bâtisse a été réhabilitée, tout est  aux normes, et elle n\'a rien à envier aux autres maisons en terme de confort.');
INSERT INTO `houses` VALUES ('80', 'Chaumière de la  Boulangère', 'Cette chaumière qui comporte un étage appartenait à une illustre boulangère dont le nom est encore inconnu. Cette chaumière est de loin la maison idéale pour tout Boulanger ou Boulangère qui se respecte.');
INSERT INTO `houses` VALUES ('81', 'Maison près du temple Xélor', 'Cette petite maison ne comporte qu\'une seule pièce, mais a l\'avantage d\'être proche du temple Xélor et proche de la boulangerie.');
INSERT INTO `houses` VALUES ('82', 'Chaumière près du temple Xélor', 'Cette chaumière qui comporte un étage, est située juste en face du temple Xélor, ce qui en fait une chaumière de choix pour les Xélors.');
INSERT INTO `houses` VALUES ('83', 'Chaumière du Tailleur', 'Cette chaumière qui dispose d\'un étage appartenait au Tailleur le plus populaire d\'Amakna, Elvis Trosse qui était spécialisé dans la confection de pantalons bleus.');
INSERT INTO `houses` VALUES ('84', 'Maisonnette du Bowisse', 'Cette splendide petite maison a été construite par Bowisse le cordonnier en personne, ce qui en fait un des bâtiments les plus populaires de tout Amakna. C\'est certainement un des lieux touristiques les plus visités juste après  la boulangerie de Xavier le Boulanger.');
INSERT INTO `houses` VALUES ('85', 'Chaumière des Bouftous', 'Cette charmante chaumière comporte un étage. Elle a beau être souvent entourée de Bouftous affamés, le fait qu\'elle soit proche d\'un temple Kanojedo lui redonne tout de suite beaucoup de valeur auprès des aventuriers débutants.');
INSERT INTO `houses` VALUES ('87', 'Chaumière près du magasin Crâ ', 'Cette chaumière qui comprend un étage, servait de maison à Edridge Valling avant qu\'elle n\'aménage le grenier de son magasin pour pouvoir y vivre. Les murs sont encore recouverts d\'impacts de flèches, mais cela donne un certain charme à cette chaumière.');
INSERT INTO `houses` VALUES ('88', 'Maison près du magasin Crâ ', 'Cette petite maison qui ne comporte qu\'une seule pièce, vaut cependant très cher du fait de sa proximité avec le magasin d\'Edridge Valling. En effet, nombreux sont les courtisans d\'Edridge qui ont acheté cette maison pour la cotoyer plus souvent.');
INSERT INTO `houses` VALUES ('89', 'Chalet de la Fonderie', 'Ce chalet en bois, comporte un étage et est situé à proximité de la fonderie. Les amateurs de métaux en fusion en auront pour leur compte avec cette maison. Attention cependant, la zone est parfois infestée de Bouftous.');
INSERT INTO `houses` VALUES ('90', 'Cahute du Marin', 'Cette cahute qui ne comporte qu\'une seule pièce, est en revanche très bien  exposée, à l\'abri des vents dominants, elle profite tout de même des rayons de soleil matinaux. Et sentir les rayons du soleil vous caresser la peau au réveil, n\'a pas de prix, c\'est bien connu.');
INSERT INTO `houses` VALUES ('91', 'Cabane du Pêcheur', 'Cette cabane qui ne comporte q\'une seule pièce, est un bâtiment classé bâtiment historique. C\'est ici que le célèbre Ménestrel Forgeur de Haches , Francisque Kabroule a écrit la majeure partie de ses chansons. ');
INSERT INTO `houses` VALUES ('92', 'Demeure du Pêcheur', 'Cette demeure qui ne comporte qu\'une seule pièce, n\'a rien d\'original si ce n\'est que c\'est dans cette demeure, que le célèbre Bowisse a passé la plus grande partie de son enfance.');
INSERT INTO `houses` VALUES ('93', 'Maisonnette du Pêcheur', 'Cette petite maison de pêcheur ne comporte qu\'une seule pièce et la façade aurait besoin d\'être refaite, mais c\'est aussi cela qui fait tout son charme.');
INSERT INTO `houses` VALUES ('94', 'Chaumière du Pêcheur', 'Cette chaumière de pêcheur comporte un étage. Elle servait il y a longtemps d\'entrepôt à crabes.');
INSERT INTO `houses` VALUES ('95', 'Bâtisse Coque', 'Cette ancienne bâtisse dispose d\'un étage. Elle appartenait au Captain Iglout, avant d\'obtenir un logement de fonction directement dans l\'enceinte de la prison.');
INSERT INTO `houses` VALUES ('96', 'Petite cahute près du port', 'Cette petite cahute ne comporte qu\'une seule pièce, mais elle est contre la mer, il est donc possible d\'entendre le ressac de la mer  à longueur de journée pour se distraire.');
INSERT INTO `houses` VALUES ('97', 'Grande Maison Coque du port', 'Cette grande maison au toit en coque de bateau, dispose de trois pièces, ce qui en fait une maison de Maître. Le fait qu\'elle soit au bord de l\'eau, permet de surcroît, de déverser ses ordures directement à la mer sans se soucier des jours de ramassage des ordures. Une certaine vision du confort en somme.');
INSERT INTO `houses` VALUES ('109', 'Maison du chemin de fer', 'Cette petite maison ne comporte qu\'une seule pièce. Elle appartenait à un ancien chef de gare, Hassan Séhef, qui a quitté sa maison, une fois que la voie ferrée a été abandonnée.');
INSERT INTO `houses` VALUES ('110', 'Petite maison près des rails', 'Cette petite maison ne comporte qu\'une seule pièce. \nElle appartenait à un ancien mineur qui allait au travail dans son petit wagon à minerai.');
INSERT INTO `houses` VALUES ('111', 'Bâtisse des Bouftous', 'Cette maison au toit de chaume, comporte un étage plutôt bien aménagé, il faut le reconnaître. Son ancien propriétaire avait l\'habitude de nourrir les Bouftous qui passaient devant sa maison pour les engraisser pendant plusieurs mois, pour ensuite les égorger avec de vieilles dagues rouillées. Une sorte de rituel assez particulier.');
INSERT INTO `houses` VALUES ('112', 'Maisonnette des Bouftous', 'Cette maisonnette ne comporte qu\'une unique pièce, et pourtant, elle est très convoitée, en effet , la présence de troupeaux de Bouftous sauvages la rend très intéressante pour les amateurs de Bouftous.');
INSERT INTO `houses` VALUES ('113', 'Maison des Champignons', 'Cette petite maison, ne comporte qu\'une seule pièce. Elle appartenait avant à un vieil Alchimiste qui utilisait énormément de champignons pour ces potions aux effets trop souvent sous-estimés. Attention, les champignons qui poussent autour sont parfois dangereux, voire même agressifs.');
INSERT INTO `houses` VALUES ('114', 'Petite maison près de la place', 'Cette petite maison de marin est située à un endroit très fréquenté par les touristes, ce qui peut poser quelques problèmes aux personnes qui recherchent la tranquillité, mais elle peut se révéler être une maison de choix, pour les personnes en manque d\'amis de passage.');
INSERT INTO `houses` VALUES ('115', 'Petite maison près de la place', 'Cette petite maison de marin ne comporte qu\'une modeste pièce, elle conviendra parfaitement, aux personnes peu matérialistes qui savent se satisfaire de peu et ne recherchent pas en premier lieu le confort, lorsqu\'ils achètent une maison.');
INSERT INTO `houses` VALUES ('116', 'Petite maison près de la place', 'Cette maison de marin ne comporte qu\'une unique pièce, mais elle a la réputation de faciliter la fécondité des couples qui y vivent, pour des raisons inconnues. Le lit unique et la petitesse de ce dernier jouent  de toute évidence un rôle important dans cette histoire.');
INSERT INTO `houses` VALUES ('117', 'Petite maison près de la place', 'Cette petite maison de pêcheur, est bien située, elle est juste à côté de la fontaine du port. Il est cependant regrettable qu\'elle ne comporte qu\'une seule pièce, ce qui est compensé par son prix relativement abordable pour une maison de ce type.');
INSERT INTO `houses` VALUES ('118', 'Maison Coque près de la place', 'Cette maison au toit en coque de bateau qui comporte un étage, est située autour de la place du port, juste en face de la fontaine, ce qui ne manquera pas d\'intéresser les marchands, qui n\'auront pas beaucoup de chemin à parcourir pour vendre à la criée sur le port.');
INSERT INTO `houses` VALUES ('119', 'Maison Coque du port', 'Cette maison au toit en coque de bateau, comporte un étage qui offre une vue sur  le phare, ce qui ne manquera pas de plaire aux plus grands romantiques d\'Amakna qui aiment séduire en profitant de la lumière du phare pour faire des ombres chinoises explicites, et dieu sait qu\'ils sont nombreux.');
INSERT INTO `houses` VALUES ('120', 'Petite maison du port', 'Cette petite maison, ne comporte qu\'une seule pièce, et pourtant, elle est si charmante, que peu de touristes résistent à l\'envie de l\'acheter. Le fait que les sanitaires donnent directement sur la mer y est de toute évidence pour beaucoup.');
INSERT INTO `houses` VALUES ('122', 'Maison du gardien de Kanojedo', 'Cette maison ne comporte qu\'une seule pièce habitable (le grenier étant condamné depuis une invasion de termites mangeuses de tuiles). Située juste à côté d\'un temple Kanojedo, elle est en général réservée aux gardiens du temple. ');
INSERT INTO `houses` VALUES ('123', 'Petite maison près du pont', 'Cette maison ne comporte qu\'une seule mais vaste pièce. Elle est située sur une île de taille respectable à l\'écart de toute civilisation tout en étant près d\'un pont, et n\'est qu\'à quelques pas d\'une fonderie. Les charges ne sont pas comprises.');
INSERT INTO `houses` VALUES ('124', 'Maison du Jardinier', 'Cette petite maison, ne comporte qu\'une seule pièce. Elle dispose en revanche d\'un petit potager, et est proche de la côte, ce qui en fait la maison rêvée de tous les paysans peu fortunés qui aiment prendre des vacances dans un endroit tranquille.');
INSERT INTO `houses` VALUES ('125', 'Chaumière près du lac', 'Cette chaumière comporte un étage classique, ainsi  qu\'une petite dépendance à côté, à acheter séparément. Ce qui vous permettra de loger facilement un gardien ou vos servants.');
INSERT INTO `houses` VALUES ('126', 'Maisonnette près du lac', 'Cette maisonnette ne comporte qu\'une seule pièce, mais elle est à la fois proche du lac et proche de la côte, ce qui ravira les amateurs de pêche en eau douce et en eau salée.');
INSERT INTO `houses` VALUES ('127', 'Petite maison près du lac', 'Cette petite maison d\'apparence modeste, ne comporte qu\'une seule pièce, mais cette dernière est spacieuse et bien aménagée. Les amateurs de pêche en eau douce et de baignades, apprécieront  le fait qu\'elle soit proche du lac.');
INSERT INTO `houses` VALUES ('128', 'Chaumière avec allée', 'Cette chaumière comporte un étage, mais les deux pièces sont très vastes, suffisamment pour organiser d\'importantes parties de Tragic The Gardening.  L\'entretien des arbres de l\'allée est laissé à la charge du propriétaire.');
INSERT INTO `houses` VALUES ('129', 'Maison de MAX-LoL', 'Cette petite maison ne comporte qu\'un seul étage, mais elle a l\'avantage d\'être située sur une petite île, ce qui la rend facilement défendable en cas d\'attaque de Roublards par exemple.');
INSERT INTO `houses` VALUES ('130', 'Maison Coque de Bateau', 'Cette maison à un étage, dispose en guise de toiture, d\'une vieille coque de bateau échoué, ce qui peut toujours se révéler utile en cas d\'importantes montées des eaux ou de marées spectaculaires.');
INSERT INTO `houses` VALUES ('131', 'Petite maison de marin', 'Cette petite maison, comporte un étage. A la fois à proximité du port et d\'un bras de mer vaseux, elle saura séduire les éleveurs de crabes qui savent tolérer la présence de voisins.');
INSERT INTO `houses` VALUES ('132', 'Maisonnette de Pêcheur', 'Cette  maisonnette de pêcheur, ne comporte qu\'une seule pièce et au fil du temps, la mer s\'en est éloignée, ce qui tout de suite a rendu cette maison moins intéressante. Les personnes un peu moins riches que les autres sauront tout de même s\'en contenter, le temps de faire quelques économies.');
INSERT INTO `houses` VALUES ('133', 'Maison au toit de coque', 'Cette maison très originale dispose d\'une coque de bateau en guise de toiture, ce qui évitera à son propriétaire de changer les tuiles de la toiture après chaque tempête. Cette maison dispose de deux étages correctement aménagés.');
INSERT INTO `houses` VALUES ('134', 'Petite maison de la rivière', 'Cette petite maison ne comporte qu\'une modeste pièce, ce qui la destine plutôt aux aventuriers solitaires ou aux colocataires de très petite taille.');
INSERT INTO `houses` VALUES ('135', 'Petite maison du Pêcheur', 'Cette toute petite maison de pêcheur qui ne comporte qu\'une seule pièce, est très convoitée par les amateurs de poissons, qui peuvent à loisir pêcher tout en restant chez eux.');
INSERT INTO `houses` VALUES ('136', 'Maison des Bouftous', 'Cette maison comporte un étage plutôt vaste, suffisamment grand pour acceuillir les réceptions de l\'Ambassadeur. La charrette de foin est offerte à l\'achat de cette maison. Attention cependant, l\'ancien propriétaire élevait des Bouftous, et ces derniers ont été libérés autour de cette maison.');
INSERT INTO `houses` VALUES ('137', 'Chaumière près du Merisier', 'Cette maison dispose d\'un étage, et d\'un magnifique escalier en bois de chêne. Son toit de chaume et le merisier qui pousse en face de la porte, en font une maison très rustique, mais très appréciée des personnes qui aiment se démarquer des autres.');
INSERT INTO `houses` VALUES ('138', 'Petite maison près du Merisier', 'Cette maison n\'est constituée que d\'une seule pièce, mais cette dernière est vaste. Un magnifique merisier procure de l\'ombre en été aux propriétaires de cette charmante demeure.');
INSERT INTO `houses` VALUES ('139', 'Maison de la scierie', 'Cette petite maison dispose tout de même d\'un étage. Sa proximité avec la scierie, en fait la maison idéale pour le propriétaire de la scierie.');
INSERT INTO `houses` VALUES ('140', 'Chaumière de la scierie', 'Cette petite maison dispose d\'un étage classique, mais est située près de la scierie, ce qui ne manquera pas de plaire aux Bûcherons, qui détestent  perdre du temps pour aller jusqu\'à leur lieu de travail.');
INSERT INTO `houses` VALUES ('141', 'Maison d\'Aria Knofob ', 'Maison de PNJ.');
INSERT INTO `houses` VALUES ('142', 'Maison montagnarde', 'Cette maison ne comporte qu\'une seule pièce, mais cette dernière est spacieuse et bien aménagée.');
INSERT INTO `houses` VALUES ('143', 'Grande Maison Coque du port', 'Cette grande maison au toit en coque de bateau, dispose de deux étages, ce qui en fait une maison de Maître. Sa proximité avec le port en fait la demeure idéale pour ceux qui aiment voyager. En revanche, le grenier est lugubre et regorge de toiles d\'araignée.');
INSERT INTO `houses` VALUES ('144', 'Maison Sufokia', 'Noble habitat, vue sur mer et haut confort intérieur. Cette maison saura vous séduire par la richesse de son ameublement.');
INSERT INTO `houses` VALUES ('145', 'Grande Maison Sufokia', 'Une maison isolée dont l\'architecture étonne par sa luminosité et son confort. Son étage possède un magnifique jardin intérieur, fort appréciable pour se détendre bercé par le son de l\'océan.');
