INSERT INTO `houses` VALUES ('882', 'Gigantesque Maison D\'éleveur', 'Ça c\'est de la baraque ! Avec une maison comme ça, à vous les belles petites écaflipettes ou les beaux grabataires enutrofs, voire même les deux ! \nEt avec quatre salles et cinq coffres, il y aura de quoi expérimenter dans ces anciens laboratoires... Cependant, les éprouvettes et les gants en peau de gloutovores ne sont pas fournis.');
