INSERT INTO `houses` VALUES ('890', 'Grande Paillote', 'Une bien belle maison, sur une île paradisiaque, tout confort qui plus est. \nVotre belle-mère ne vous lâchera jamais. \nHeureusement, les trois coffres de cette demeure seront amplement suffisants pour dissimuler le cadavre.');
INSERT INTO `houses` VALUES ('891', 'Petite Paillote', 'Cette jolie petite maison saura charmer les petites bourses. \nNéanmoins les demoiselles ne seront pas en reste, son unique coffre étant amplement suffisant pour contenir toute leur garde-robe et autre nécessaire à maquillage.');
INSERT INTO `houses` VALUES ('892', 'Moyenne Paillote', 'Cette charmante demeure ravira les jeunes couples avides d\'eau de mer et de crustacés. Un coffre pour monsieur, un coffre pour madame, cette maison est destinée aux couples indépendants.');
